import { useState } from "react";

const App = () => {
    const [count, setCount] = useState(0);

    const handleIncrease = () => {
        setCount(count + 1);
    }

    const handleDecrease = () => {
        setCount(count - 1);
    }

    return (
        <div>
            <button onClick={() => handleIncrease()}>+1</button>
            <button onClick={() => handleDecrease()}>-1</button>
        </div>
    )
}

export default App;
